// import React from "react";
import Button from "./Button";
import logo from "../Assets/vividspace2.png"
import { Link } from "react-router-dom";
const Header = () => {
    return (
<router>
        <header className="">
            <div className="flex h-36 bg-white justify-between px-10">
            <img id="logo" src={logo} alt="logo" className="pt-3"></img>
            <div className="flex ">
            <Button text="Sign In" to="/signin" />
            <Button text="Sign Up"/>
        </div> </div>
        </header>


</router>
);
}

export default Header;
